   return (
    <Swiper
    spaceBetween={10}
    slidesPerView={3}
    navigation
    pagination={{ clickable: true }}
   
   
  >
    <SwiperSlide >
        <img src={Logo} style={{width:"35rem",height:"35rem"}}></img>
